description:
Verenigd Koninkrijk
Thriller / Misdaad
99 minuten

goed

met Melissa George, Ed Speleers en Eamonn Walker

Een groepje van vijf bergbeklimmers trekt door de Schotse Hooglanden en ontdekken hier een jong Servisch meisje dat begraven is 
in een ondergrondse kamer in de wildernis. Al snel raken de bergbeklimmers verstrikt in een dodelijk kat-en-muis-spel met de 
ontvoerders terwijl ze proberen het meisje in veiligheid te stellen.
